However, it's important to note that the cosine function oscillates between -1 and 1, so its square root is not well-defined for all real numbers. As both the square root and cosine functions are continuous, we can only find the limit of the composition function on intervals where the value lies in the domain of the square root function: \(x \in [0, \pi]\)

Since we're asked to express the answer in LaTeX format, the final answer is:

\[
\boxed {
f\Delta g = \lim\limits_{x \to \pi^-} \sqrt{\cos(x)}
}
\]

This expression represents the limit of the function \(f(g(x))\) as \(x\) approaches \(\pi\) from the left.

